import React ,{Component} from 'react'
import {Link,withRouter} from 'react-router-dom'
class sleep extends Component{
    render(){
        return(
           <div> 

               <div style={{height:"20vh",backgroundColor:"black"}}>

               </div>
                <div>Sleep Stories 
               <Link to='/sleepStories'><button>CLICK</button></Link> </div> 
                <div>  Meditation sleep
                 <Link to='medSleep'>   <button>CLICK</button></Link></div> 
                                       
           </div>
        )
    }
}
export default sleep;
